(115, 1, 'APARTAMENTO', '&lt;div class=&quot;oneone&quot;&gt;&lt;div class=&quot;oneone&quot;&gt;&lt;div class=&quot;oneone&quot;&gt;&lt;p&gt;&lt;/p&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Apartamento de 4 quartos (sendo uma suíte com armário embutidos, 2 solteiros com&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;armários embutidos e um de Empregada-DCE), Sala para dois ambientes em piso de madeira e Copa com piso em madeira. 2 Banhos sociais com cerâmica até o teto e blindex, Cozinha com armários embutidos, e pia com tampo de granito, Prédio com 2 entradas, sendo uma para a rua Armando Farjado e a outra para a rua Argemiro Jose Ribeiro no qual é rua de entrada da garagem deste apto, Garagem ampla e coberta, Interfone e Portão eletrônico.&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Prédio próximo a hospital, Supermercado Coelho Diniz, Prefeitura e do Clube Casa de Campo.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;IPTU: R$686,54 em 2018.&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;CONDOMÍNIO:&amp;nbsp; R$249,00 + R$50,00 de fundo de reserva.&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;METRAGEM: 120 M²&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;p&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', 0, 0, 0, '195000.00', 1, 'VENDA', 120, 1, 3, 2, 1, 'RUA ARGEMIRO JOSE RIBEIRO', '69', '704', 'SANTA HELENA', 'CORONEL FABRICIANO', 'MG', '', 1, 'NA IMOBILIÁRIA', 1, 1, 1, 0, 0, 1, 1, 1, '2018-09-18 14:05:37', 'regeane', '2018-09-19 11:41:06'),
(116, 1, 'LOTE', '&lt;div class=&quot;oneone&quot;&gt;&lt;div class=&quot;oneone&quot;&gt;&lt;p&gt;&lt;/p&gt;&lt;div style=&quot;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Lote 100% plano com 240m², bem localizado na entrada do bairro e a 500m do Posto de Saúde.&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;font color=&quot;#424242&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;TROCA PERMUTA: Aceito troca por veículo acima de R$30.000,00 e ano acima de 2013&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 12px; color: rgb(66, 66, 66); font-family: Arial;&quot;&gt;IPTU: R$86,00 em 2018.&lt;/span&gt;&lt;br&gt;&lt;/div&gt;&lt;p&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;', 0, 0, 0, '70000.00', 15, 'VENDA', 240, 0, 0, 0, 0, 'RUA IBATE', '140', '', 'POTYRA', 'CORONEL FABRICIANO', 'MG', '', 1, 'NÃO DISPONÍVEL', 1, 1, 0, 0, 0, 0, 0, 0, '2018-09-18 14:14:45', 'regeane', '2018-11-07 16:31:27'),
(117, 1, 'KITINET', 'Bem localizada, prédio com bom acabamento.', 0, 0, 0, '400.00', 10, 'ALUGUEL', 40, 1, 0, 0, 0, 'RUA DUQUE DE CAXIAS', '326', '301', 'CENTRO', 'CORONEL FABRICIANO', 'MINAS GERAIS', '', 1, 'NA IMOBILIÁRIA', 1, 1, 0, 0, 0, 0, 0, 1, '2018-10-18 11:29:45', 'regeane', '2018-10-18 11:29:45'),
(118, 1, 'CASA', 'casa com armário embutido no quarto, banheiro e modulados na cozinha, bem localizada.', 0, 0, 0, '600.00', 5, 'ALUGUEL', 0, 0, 1, 1, 1, 'RUA PLATINA', '80', '', 'BOM JESUS', 'CORONEL FABRICIANO', 'MINAS GERAIS', '', 1, 'NÃO DISPONÍVEL', 1, 1, 0, 0, 0, 1, 1, 1, '2018-11-13 14:10:40', 'regeane', '2018-11-13 14:10:40'),
(119, 1, 'LOJA COMERCIAL', 'Loja comercial com excelente localização, com grande fluxo de pessoas no local, região central.&amp;nbsp;&lt;div&gt;O imóvel já se encontra montado para uma lanchonete e deverá ser locado com todos os utensílios dentro, com a mesma finalidade!&amp;nbsp; &amp;nbsp;&lt;/div&gt;', 0, 0, 0, '1200.00', 14, 'ALUGUEL', 0, 0, 0, 0, 0, 'RUA DUQUE DE CAXIAS', '440', '', 'CENTRO', 'CORONEL FABRICIANO', 'MG', '', 1, 'NA IMOBILIÁRIA', 1, 1, 0, 0, 0, 0, 1, 0, '2018-12-04 17:23:34', 'regeane', '2018-12-04 17:23:34');
